import React, {Component} from 'react';
import User from './User';


class Users extends Component {
	state = {
		users : [
			{name: "John", age : 12},
			{name: "Abhi", age : 13}
		],
		title : "User List"
	};

	makeStateChange = () => {
		this.setState ({
			users : [
				{name: "John", age : 22},
				{name: "Abhi", age : 23}
			],
		})
	}
  render() {
    return (
    	<div>
	        <User age ="12">Abhi</User>
	        <User age = "11">Guldu</User>
        </div>
    )
  }
}

export default Users;
